import React , {Component} from 'react';
import mergeImages from 'merge-images';


export default class Img extends Component {
  
  constructor(props){
    super(props);
}



render(){
    return (
         <div>
             <img src={mergeImages(this.props.listado)}/>
         </div>
    );
  }
 
}
